import React, { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";

const ViewTenant = () => {
  const { tenant_id } = useParams();
  const navigate = useNavigate();
  const [tenant, setTenant] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchTenantDetails();
  }, [tenant_id]);

  const fetchTenantDetails = async () => {
    try {
      const res = await fetch(`http://localhost:5000/view_tenant/${tenant_id}`, {
        credentials: "include",
      });
      const data = await res.json();

      if (res.ok && data.success) {
        setTenant(data.tenant);
      } else {
        alert(data.message || "Failed to load tenant");
      }
    } catch (err) {
      console.error(err);
      alert("Error fetching tenant details");
    } finally {
      setLoading(false);
    }
  };

  if (loading) return <p>Loading tenant details...</p>;
  if (!tenant) return <p>Tenant not found</p>;

  return (
    <div style={{ fontFamily: "Arial, sans-serif", padding: 20 }}>
      <h2
        style={{
          textAlign: "center",
          background: "#273c75",
          color: "white",
          padding: 15,
          borderRadius: 6,
        }}
      >
        Tenant Details
      </h2>

      <div
        style={{
          background: "#fff",
          borderRadius: 8,
          padding: 20,
          marginTop: 20,
          boxShadow: "0 2px 6px rgba(0,0,0,0.1)",
        }}
      >
        <button
          onClick={() => navigate(-1)}
          style={{
            backgroundColor: "#7f8c8d",
            color: "white",
            border: "none",
            borderRadius: 6,
            padding: "8px 12px",
            marginBottom: 20,
            cursor: "pointer",
          }}
        >
          ‚Üê Back
        </button>

        <h3 style={{ color: "#2980b9" }}>{tenant.TenantName}</h3>
        <p>
          <strong>Date of Birth:</strong> {tenant.TenantDOB?.slice(0, 10)}
        </p>
        <p>
          <strong>Nationality:</strong> {tenant.TenantNationality}
        </p>
        <p>
          <strong>Email:</strong> {tenant.TenantEmailID}
        </p>
        <p>
          <strong>Mobile:</strong> {tenant.TenantMobileNumber}
        </p>
        <p>
          <strong>Employer:</strong> {tenant.TenantEmployer}
        </p>
        <p>
          <strong>Lease Period:</strong> {tenant.LeaseStartDate?.slice(0, 10)} ‚Üí{" "}
          {tenant.LeaseEndDate?.slice(0, 10)}
        </p>
        <p>
          <strong>Rent:</strong> {tenant.RentAmount}
        </p>
        <p>
          <strong>Deposit:</strong> {tenant.DepositAmountReceived}
        </p>

        <hr style={{ margin: "20px 0" }} />

        <h4>Documents</h4>
        {tenant.PassportCopyPath && (
          <p>
            <a
              href={`data:application/pdf;base64,${tenant.PassportCopyPath}`}
              target="_blank"
              rel="noreferrer"
            >
              üìÑ View Passport Copy
            </a>
          </p>
        )}
        {tenant.EIDCopyPath && (
          <p>
            <a
              href={`data:application/pdf;base64,${tenant.EIDCopyPath}`}
              target="_blank"
              rel="noreferrer"
            >
              üìÑ View EID Copy
            </a>
          </p>
        )}
      </div>
    </div>
  );
};

export default ViewTenant;
